export const MarkdownContent_ex = "## Building a Simple LLM Application using LangChain\n\n**Lab Manual**\n\n**Instructor:** Aruna Gawade\n\n**Course:** Large Language Model\n\n**Date:** 2024-11-01\n\n**1. Title:** Building a Simple LLM Application using LangChain\n\n**2. Aim:** \n\nTo build a basic LLM application using the LangChain library. This will involve understanding the core components of LangChain, such as chains, prompts, and agents, and applying them to a practical use case.\n\n**3. Theory:**\n\nLangChain is a powerful library that simplifies the process of building LLM applications. It provides a modular and flexible framework for integrating LLMs with other data sources and tools. Key concepts include:\n\n* **Chains:** Chains connect different components of an LLM application, allowing for sequential or conditional execution of tasks.\n* **Prompts:** Prompts are the instructions given to the LLM, guiding its behavior and providing context.\n* **Agents:** Agents are autonomous entities that can interact with the environment, gather information, and take actions based on LLM responses.\n\n**4. Procedure:**\n\n**Step 1:**  Install necessary libraries:\n\n```bash\npip install langchain openai\n```\n\n**Step 2:** Choose a use case:\n\n*  **Example 1:** Building a simple chatbot that answers basic questions about a specific topic (e.g., a movie, a book).\n*  **Example 2:** Creating an application that summarizes text documents using an LLM.\n\n**Step 3:** Define your LLM:\n\n```python\nfrom langchain.llms import OpenAI\n\nllm = OpenAI(api_key=\"YOUR_OPENAI_API_KEY\")\n```\n\n**Step 4:**  Construct the LangChain chain:\n\n* **Example 1 (Chatbot):**\n    ```python\n    from langchain.chains import ConversationChain\n\n    conversation_chain = ConversationChain(llm=llm) \n    ```\n* **Example 2 (Summarization):**\n    ```python\n    from langchain.chains import SummarizeChain\n\n    summarize_chain = SummarizeChain(llm=llm)\n    ```\n\n**Step 5:** Implement the application logic:\n\n* **Example 1 (Chatbot):**\n    ```python\n    while True:\n        user_input = input(\"You: \")\n        if user_input == \"quit\":\n            break\n        response = conversation_chain.run(user_input)\n        print(\"Chatbot:\", response)\n    ```\n* **Example 2 (Summarization):**\n    ```python\n    text_to_summarize = \"\"\"[Your text to summarize]\"\"\"\n    summary = summarize_chain.run(text_to_summarize)\n    print(\"Summary:\", summary)\n    ```\n\n**5. Results:**\n\n* **Example 1 (Chatbot):**  Demonstrate a conversation with the chatbot, showcasing its ability to understand user queries and provide relevant responses.\n* **Example 2 (Summarization):**  Display the original text and its generated summary. Evaluate the effectiveness of the summarization chain.\n\n**6. Conclusion:**\n\n* Summarize the steps taken to build the LLM application using LangChain. \n* Discuss the advantages and limitations of the chosen approach.\n* Propose future improvements or extensions for the application.\n* Reflect on the practical implications of LLM technology and its potential applications. \n"